สนามสี่เหลี่ยมผืนผ้าถูกล้อมรอบด้วยลู่วิ่งกรีฑา ดังที่แสดงด้านล่าง ลู่วิ่งประกอบด้วยสองขอบของสนามและสองครึ่งวงกลม ความยาวของลู่วิ่งคือ 400 เมตร พื้นที่ที่ใหญ่ที่สุดที่เป็นไปได้ของสนามคือเท่าใดในหน่วยตารางเมตร?

[asy]
unitsize(1 cm);

filldraw((0,0)--(3,0)--(3,2)--(0,2)--cycle,lightgreen);
draw((0,0)--(3,0),linewidth(2*bp));
draw((0,2)--(3,2),linewidth(2*bp));
draw(arc((3,1),1,-90,90),linewidth(2*bp));
draw(arc((0,1),1,90,270),linewidth(2*bp));
[/asy]

